import Navbar from './components/Navbar';
import TextForm from './components/TextForm';

let name = "Tajinder";

function App() {
  return (
    <Navbar title="Second title"/>
  );
}

function Head(props){
  return (
    <div className="container p-4">
      <h1>My Name is {props.name}</h1>
    </div>
  );
}
function Form(){
  return(
    <TextForm heading="This is a testing form."/>
  )
}

